query Ticker {
  listTickers {
    id,
    volume_24h {amount}
    bestAskPrice {amount},
    bestBidPrice {amount},
    lastPrice {amount},
    highPrice_24h {amount},
    lowPrice_24h {amount},
    market {
      aUnit,
      aAsset {name},
      bAsset {name},
      bUnit
    }
  }
}
